import React from 'react'
import './App.css';

class App extends React.component {
	render() {
		return (
			<div className="App">
				<header className="App-header">


					<a
						className="App-link"
						href="https://reactjs.org"
						target="_blank"
						rel="noopener noreferrer"
					>
						Learn React
					</a>
				</header>
			</div>
		);
	}
}

export default App;
